import Navbar from '../components/navbar';
// import WazuhAgents from '../components/wazuh_agents';
import './Home.css';
// import WazuhCombined from '../components/wazuh_combined';
import SiemPieChart from '../components/siem-piechart';
import SiemBarChart from '../components/siem-barchart';
import { Link } from 'react-router-dom';
// import SearchBar from '../components/searchbar';

// import WazuhActive from '../components/wazuh_active';
// import WazuhInactive from '../components/wazuh_inactive';

function SIEM() {
  return (
      <div className='container-fluid p-0' style={{marginTop:"20px",maxHeight:"1560px",background:"rgb(240,242,245)"}}>
        <div className="row" style={{height:""}}>
          <div className="col-2">
            <Navbar />
          </div>
        
        
        <div className='col-10 '>
            <span className='ps-5  '><b>Pages</b> /SIEM</span>
            <button type='button' className='btn btn-primary' style={{marginLeft:"1000px"}}>Alerts</button>

             <div className="charts-container mt-5">
                <SiemPieChart/>
                <SiemBarChart/>                 
             </div>
             <h3 className='' style={{marginLeft:"510px"}}>Alerts</h3>
             <div>
             <div class="list-group w-25 ps-5" style={{marginLeft:"840px",position:"absolute",marginTop:"-610px"}}>
  <Link to="/" class="list-group-item list-group-item-action " aria-current="true">
    <div class="d-flex w-100 justify-content-between">
      <h5 class="mb-1">List group item heading</h5>
      <small>3 days ago</small>
    </div>
    <p class="mb-1">Some placeholder content in a paragraph.</p>
    <small>And some small print.</small>
  </Link>
  <Link to="/" class="list-group-item list-group-item-action">
    <div class="d-flex w-100 justify-content-between">
      <h5 class="mb-1">List group item heading</h5>
      <small class="text-body-secondary">3 days ago</small>
    </div>
    <p class="mb-1">Some placeholder content in a paragraph.</p>
    <small class="text-body-secondary">And some muted small print.</small>
  </Link>
  <Link to="/" class="list-group-item list-group-item-action">
    <div class="d-flex w-100 justify-content-between">
      <h5 class="mb-1">List group item heading</h5>
      <small class="text-body-secondary">3 days ago</small>
    </div>
    <p class="mb-1">Some placeholder content in a paragraph.</p>
    <small class="text-body-secondary">And some muted small print.</small>
  </Link>
</div>


             </div>
        </div>
       
        </div>
        </div>
  )
}

export default SIEM
